import react from "react";

function TodoItem(props){
    return(
        <li>
            <span className={`Icon Icon-check ${props.complete && 'icon-check--active'}`}>✔</span>
            <p className={`TodoItem-p ${props.complete && 'icon-check--active'}`}>{props.text}</p>
            <span>❌</span>
        </li>
    );
}

export { TodoItem };
